                    type: 'scatter',
                    mode: 'lines',
                    name: 'Support/Resistance',
                    x: data.map(d => d.date),
                    y: data.map(d => d.support_20d),
                    line: {color: '#2CA02C'}
                };

                Plotly.newPlot('sr-chart', [srChart], {
                    title: 'Support Levels',
                    paper_bgcolor: '#2d2d2d',
                    plot_bgcolor: '#2d2d2d',
                    font: {color: '#fff'},
                    xaxis: {gridcolor: '#444', title: 'Date'},
                    yaxis: {gridcolor: '#444', title: 'Level'}
                });

                // Range Chart
                const rangeChart = {
                    type: 'scatter',
                    mode: 'lines',
                    name: '20-Day Range',
                    x: data.map(d => d.date),
                    y: data.map(d => d['20dayrange']),
                    line: {color: '#9467BD'}
                };

                Plotly.newPlot('range-chart', [rangeChart], {
                    title: '20-Day Price Range',
                    paper_bgcolor: '#2d2d2d',
                    plot_bgcolor: '#2d2d2d',
                    font: {color: '#fff'},
                    xaxis: {gridcolor: '#444', title: 'Date'},
                    yaxis: {gridcolor: '#444', title: 'Range'}
                });
            </script>
        </body>
        </html>
